import { gql } from '@apollo/client';

export const CREATE_HAIKU_MUTATION = gql`
  mutation createHaikus {
  createHaikus(
    input: {content: $content, collected: false, submitted: false, featured: false}
  ){
    haikus {
      id
    }
  }
}

`
